INSERT INTO `leave_days` VALUES (1,'Republic Day','The Republic Day of India is a national holiday of India to mark the adoption of the Constitution of India and the transition of India from a British Dominion to a republic on January 26, 1950. It is one of the three national holidays in India.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(2,'Maha Shivratri','Maha Shivratri, the night of the worship of Lord Shiva, occurs on the 14th night of the new moon during the dark half of the month of Phalguna. It falls on a moonless February night, when Hindus offer special prayer to the lord of destruction.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(3,'Holi','Holi, also known as Dhuli Vandana in Sanskrit,also Dhulheti, Dhulandi or Dhulendi, is celebrated by people throwing coloured powder and coloured water at each other.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(4,'Mahavir Jayanti','In Jainism, Mahavir Jayanti is the most important religious holiday. It celebrates the birth of Mahavira, the last Tirthankara. He was born on the 13th day of the rising moon of Chaitra, in either 599 BC or 615 BC (depending on religious tradition).','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(5,'Good Friday','Good Friday, also known as Holy Friday, Black Friday, Great Friday, is a religious holiday observed primarily by Christians commemorating the crucifixion of Jesus Christ and his death at Calvary.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(6,'May Day','May Day is commemorated in India as the Labour Day which began with the United States Labour Movement on May 1, 1886.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(7,'Buddha Purnima','Buddha Jayanti or also known as Buddha Purnima is the most sacred festivals of Buddhist. Buddha Purnima (Buddha Birthday) is celebrated in remembrance Lord Buddha. Lord Buddha is the founder of Buddhism. This day is the birth anniversary of Lord Buddha.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(8,'Independence Day','India\'s Independence Day is celebrated on August 15 to commemorate its independence from British rule and its birth as a sovereign nation on that day in 1947. The day is a national holiday in India.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(9,'Krishna Janmastami','Krishna Janmashtami , also known as \"Krishnashtami\",\"Saatam Aatham\" ,\"Gokulashtami\", \"Ashtami Rohini\", \"Srikrishna Jayanti\", \"Sree Jayanthi\" or sometimes merely as \"Janmashtami\", is a Hindu festival celebrating the birth of Lord Krishna, an avatar of the Hindu deity Vishnu.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(10,'Id-Ul-Fitr','Eid al-Fitr often abbreviated to Eid, is a Muslim holiday that marks the end of Ramadan, the Islamic holy month of fasting (sawm).The holiday symbolizes the breaking of the fasting period.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(11,'Ganesh Chaturthi','Ganesha Chaturthi , also known as Vinayaka Chaturthi, is the Hindu festival of Ganesha. It is the birthday of Lord Ganesha who is widely worshiped as the god of wisdom, prosperity and good fortune.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(12,'Mahatma Gandhi Jayanthi','Gandhi Jayanti is a national holiday celebrated in India to mark the occasion of the birthday of Mahatma Gandhi, the \"Father of the Nation\". It is celebrated on October 2, every year. It is one of the three official declared National Holidays of India and is observed in all its states and union territories.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(13,'Vijaya Dashami','Vijayadashami is a festival celebrated in varying forms across Nepal and India. It is celebrated on the tenth day of the bright fortnight (Shukla Paksha) of the Hindu autumn month of Ashvin or Ashwayuja, and is the grand culmination of the 10-day annual Navaratri festival. Vijayadashami is also known as Dasara, Dashahara, Navaratri, and Durgotsav. It is celebrated in the lunar month of Ashwin from the Shukla Paksha Pratipada to the Dashami, or the tenth day of Ashwin.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(14,'Diwali','Diwali (often written Deepavali) is a significant festival in Hinduism, Sikhism, Buddhism, and Jainism, and an official holiday in India. Adherents of these religions celebrate Diwali as the Festival of Lights. They light diyasâ€”cotton-like string wicks inserted in small clay pots filled with coconut oilâ€”to signify victory of good over the evil within an individual.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(15,'Guru Nanak Jayanthi','Guru Nanak Jayanti is the birthday of the first Sikh Guru, Guru Nanak, and one of the most sacred festivals in Sikhism. Guru Nanak Dev Ji (the First Guru, the founder of Sikhism) was born on 14 April 1469 in Rai-Bhoi-di Talwandi in the present Shekhupura District of Pakistan, now Nankana Sahib.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(16,'Christmas','Christmas or Christmas Day is a holiday observed mostly on December 25 to commemorate the birth of Jesus, the central figure of Christianity.','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(17,'New Year\'s Day','First Day of New Year','',NULL,NULL,6,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(18,'Makar Sankranti','','',NULL,NULL,0,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(19,'Pongal','','',NULL,NULL,0,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(20,'Basanta Panchami /Sri Panchami','','',NULL,NULL,0,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(21,'Guru Ravida\'s birthday','','',NULL,NULL,0,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(22,'Swami Dayananda Saraswati Jayanti','','',NULL,NULL,0,'','2012-07-11 17:12:45','0000-00-00 00:00:00',0,1),(23,'